import React, { useState, useEffect } from 'react';
import gallery from '../../Assets/low-angle-shot-mesmerizing-starry-sky.jpg';
import { MDBInput } from 'mdb-react-ui-kit';
import axios from 'axios';
import './AgentBooking.css'



const AgentBooking = () => {

    const [location, setLocation] = useState([]);
    const [selectedValue, setSelectedValue] = useState('');
    const [iselectedValue, setISelectedValue] = useState('');
    const [selectedPack, setSelectedPack] = useState({
        packageId: 1,
        userEmail: '',
        startDate: '',
        endDate: '',
        totalCount: '',
        totalPrice: '',
        status: true,
      });
    useEffect(() => {
        const fetchCarouselData = async () => {
            try {
                const response = await axios.get('https://localhost:7026/UserSide/DisplayingAllLocations');
                console.log(response.data);
                setLocation(response.data); // Assuming the API response contains the data for carousel items
            } catch (error) {
                console.error(error);
            }
        };

        fetchCarouselData();
    }, []);

    const handleChange = (event) => {
        console.log(event.target.value);
        setISelectedValue(event.target.value)
        fetchLocationName(event.target.value);
    };

    const fetchLocationName = async (placeName) => {
        try {
            const response = await axios.get(`https://localhost:7026/AgentSide/GetLocationId?locationName=${placeName}`);
            console.log(response.data);
            setSelectedValue(response.data); // Assuming the API response contains the data for carousel items
        } catch (error) {
            console.error(error);
        }
    };

    const PostPackage=()=>{

    }

    return (
        <div>
            <div>
                <img src={gallery} className='gallery-img' alt='Gallery' />
            </div>
            <div className='book-head'>ADD PACKAGE</div>

            <div className='container mt-5'>
                <div className='booknow-box'>
                    <h3 className='mt-3 text-center' >ADDING PACKAGE</h3>
                    <select className='increase-width mt-5 mb-3' value={iselectedValue} onChange={handleChange}>
                        <option value="">Select a Location</option>
                        {location.map((item) => (
                            <option key={item.id} value={item.locationName}>
                                {item.locationName}
                            </option>
                        ))}
                    </select>
                    <div>
                        <MDBInput className='mb-3' label='Package Name' id='typeText' type='text' />
                    </div>

                    <div>
                        <MDBInput className='mb-3'  label='' id='typeText' type='file' />
                    </div>
                    <div>
                        <MDBInput className='mb-3'  label='Total Number of Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput className='mb-3'  label='Price Per Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput className='mb-3' label='Person Limit' id='typeText' type='number' />
                    </div>

                    {/* Submit button */}
                    <button className='btn btn-primary mt-3 upload-cancel' onClick={PostPackage}>Submit</button>
                </div>
            </div>

            {/* Second Box */}
            <div className='container mt-5'>
                <div className='booknow-box'>
                    <h3 className='mt-3 text-center' >ADDING DAY SCHEDULES</h3>
                    <select className='increase-width mt-5 mb-3' value={selectedValue} onChange={handleChange}>
                        <option value="">Select a Spot</option>
                        {/* {location.map((item) => (
                            <option key={item.id} value={item.value}>
                                {item.locationName}
                            </option>
                        ))} */}
                    </select>
                    <div>
                        <MDBInput className='mb-3' label='Package Name' id='typeText' type='text' />
                    </div>

                    <div>
                        <MDBInput className='mb-3'  label='' id='typeText' type='file' />
                    </div>
                    <div>
                        <MDBInput className='mb-3'  label='Total Number of Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput className='mb-3'  label='Price Per Person' id='typeText' type='number' />
                    </div>
                    <div>
                        <MDBInput className='mb-3' label='Person Limit' id='typeText' type='number' />
                    </div>

                    {/* Submit button */}
                    <button className='btn btn-primary mt-3 upload-cancel' >Submit</button>
                </div>
            </div>


        </div>

    )
}

export default AgentBooking
